import Track from "../Track";
import HowItWorks from "../HowItWorks";

const Home = () => {

  return (
    <Fragment>
        <Header/>
        <Track/>
        <HowItWorks/>
    </Fragment>
)};


export default connect(
  undefined,
  undefined,
